import React from 'react';
import Link from 'next/link';

const firstd = () => {
    return (
        <div>
            <Link href="/">
                    <a>Home</a>
                </Link>
            <h1 align="center">first dynamic route output</h1>
            
        </div>
    );
};

export default firstd;
